import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
export default function House(props) {
  return (
      <div className=" p-3 rounded-lg flex flex-row sm:columns-3xs  border hover:shadow-lg ease-linear transition-all duration-150">

        <Card sx={{ maxWidth: 500 }}>
          <CardMedia
            component="img"
            height="100"
            image={`${props.url}`}
            alt="green iguana"
          />
          <CardContent>
            <Typography gutterBottom variant="h5" component="div">
            {props.name}
            </Typography>
            <Typography variant="body2" color="text.secondary">
            {props.intro}
            </Typography>
          </CardContent>
          <CardActions>
            <Button size="small">{props.score.toFixed(1)}</Button>
            <Button size="small">{props.price}</Button>
          </CardActions>
        </Card>

      </div>
  );
}
